    return (
        <Container fluid >
            <Row>
                {/* product Image slider and thumbnails */}
                <Col style={{ backgroundColor: "red" }}>
                </Col>
                {/* Product infod accordion */}
                <Col style={{ backgroundColor: "green" }}></Col>
            </Row>
        </Container>
    )
}
